def isBeautiful(p, m):
    l, r = 0, 0
    while r < len(p) and l <= r:
        if p[r] == m:  # Если нашли место для m - сдвигаем левую границу. т.к. справа от m уже нет чисел <= m. (Порядок)
            l += 1   # Сдвигаем левую границу. (Порядок)

        elif p[r] > m:   # Если p[r] > m - сдвигаем правую. (Порядок)
            r += 1

        else:   # p[r] < m - сдвигаем левую. (Порядок)
            l += 1

    return r == len(p)

